+  .hamburger {
+    display: block;
+  }
+  nav ul {
+    display: none;
+  }
+}
+.maroon_color{
+    color : #800e13;
+}
+.maroon_color_bold{
+    color : #800e13;
+    font-weight: 500;
+}
+.buythelatest_section{
+    font-size:40px;
+}
+
+#mycards{
